// Export icon names
export const iconNames = Object.keys(phosphorIcons);

// Helper function to create icon elements
export function createIcon(iconName, options = {}) {
	const { size = 24, color = 'currentColor', className = '' } = options;
	const iconSvg = phosphorIcons[iconName];
	if (!iconSvg) return null;

	const div = document.createElement('div');
	div.innerHTML = iconSvg;
	const svg = div.firstElementChild;

	if (svg) {
		svg.setAttribute('width', size);
		svg.setAttribute('height', size);
		svg.style.color = color;
		if (className) svg.className = className;
	}

	return svg;
}
